CREATE DEFINER=`root`@`localhost` PROCEDURE `getDevelopers`(IN game_num BIGINT, INOUT devList varchar(1000))
begin
declare isDone integer default 0;
declare dev_val varchar(255) default "";
declare devCursor cursor for
select Company.name 
from Developed_Game, Company 
where Company.id = Developed_Game.company_id
AND Developed_Game.game_id = game_num;
declare continue handler
for not found set isDone = 1;
open devCursor;
getList: loop
fetch devCursor into dev_val;
if isDone = 1 then
leave getList;
end if;
set devList = concat_ws(", ",dev_val, devList);
end loop getList;
set isDone = length(devList);
set isDone = isDone - 2;
set devList = substring(devList,1,isDone);
close devCursor;
end ;;
DELIMITER ;
